import React, { Component } from 'react';
import TotalWinners from '../TotalWinners/TotalWinners';
import VisitLinks from '../VisitLinks/VisitLinks';
import GrandPrixCounter from '../GrandPrixCounter/GrandPrixCounter';
import FavoriteTrackDisplay from '../FavoriteTrackDisplay/FavoriteTrackDisplay';
import GamePlayTimer from '../GamePlayTimer/GamePlayTimer';
import CompleteEvents from '../CompleteEvents/CompleteEvents';
import DistanceCounter from '../DistanceCounter/DistanceCounter';
import './Home.css';

export class Home extends Component {
  render() {
    return (
      <div className="container">
        <div className="row">

          <div className="content-con col l4 s12 ">
            <div className="responsive-img f1 col  s12 text-white"><GrandPrixCounter /></div>
            <div className="responsive-img stripe col  s6 text-white"><CompleteEvents /></div>
            <div className="responsive-img revflag col  s6 text-white"><DistanceCounter /></div>
          </div>


            <div className="responsive-img track col l4 s12 text-white"><FavoriteTrackDisplay /></div>


          <div className="content-con col l4 s12">

            <div className="responsive-img revstripe col  s6 text-white"><TotalWinners /></div>
            <div className="responsive-img flag col  s6"><GamePlayTimer /></div>
            <div className="responsive-img visit col  s12"><VisitLinks /></div>

          </div>

        </div>
      </div>
    )
  }
}

export default Home;
